(72,"Tears of Avia",10072,"2013-11-19","Tears of Avia is a turn-based tactical RPG. Play with up to 5 classes and hundreds of skills, finding the best synergy with your party and their skill loadout will mean the difference between success and failure. Run a balanced party or roll nothing but warriors, the choice is yours. With some skills being weapon bound rather than class bound, there are endless possibilities for you to experiment from.",15),
(73,"PLAYERUNKNOWNS BATTLEGROUNDS",10073,"1981-11-23","PLAYERUNKNOWNS BATTLEGROUNDS is a last-man-standing shooter being developed with community feedback. Starting with nothing, players must fight to locate weapons and supplies in a battle to be the lone survivor. This realistic, high tension game is set on a massive 8x8 km island with a level of detail that showcases Unreal Engine 4s capabilities.",55),
(74,"Sudden Strike 4",10074,"1987-2-18","Sudden Strike is back! The beloved Real Time Strategy series returns, this time with bigger battlefields, more units, better graphics, new scenarios and legendary commanders with individual abilities  all of which makes Sudden Strike 4 more tactical and realistic than ever before! 
 
Developed as a fully-fledged series entry and not a remake or reboot, Sudden Strike 4 sends you off on three extensive campaigns set amongst the battlefields of World War II. Commanding the British and American, German or Soviet troops, you will lead over 100 different units into battle, including the German bomber Heinkel He111, the Russian T-34 tank, the British Hawker Typhoon fighter plane and the notorious German Panzerkampfwagen VI Tiger. In a first for the Sudden Strike series, you can now choose from one of nine individual commanders, such as George Patton or Bernard Montgomery, who will each allow f",50),
(75,"Half-Life 3",10075,"2008-10-26","The long awaited final part of the Half-Life saga.",35),
(76,"GOKEN",10076,"1994-5-9","Action RPG A genre that defined adventure and represented the childhood of all gamers, revived, redefined, from Japan, on Steam. GOKEN will bring back everything that was right about gaming in an action packed open world environment and have the old school gamers tremble in nostalgia.",15),
(77,"Little Busters!",10077,"2000-2-13","Little Busters! is a Japanese visual novel developed by Key. The story follows the life of Riki Naoe, a high school student who has been a member of a group of friends named the Little Busters since childhood. Riki brings multiple girls at his school into the Little Busters to have enough people to play a baseball game. The game is rated for all ages in Japan, but a version containing adult content named Little Busters! Ecstasy exists as well.",40),
(78,"Lunacy",10078,"2004-10-2","Psychological horror game in which an eleven year old Elijah Grey and his mother Katarina bought a house recently. The first time he was left alone in the big house, he started feeling someone elses presence. The more he explored, the more he found out about the sinister past of this frightening house and attracted someones attention.",55),
(79,"Middle-earth: Shadow of War",10079,"1997-5-9","Go behind enemy lines to forge your army, conquer Fortresses and dominate Mordor from within. Experience how the award winning Nemesis System creates unique personal stories with every enemy and follower, and confront the full power of the Dark Lord Sauron and his Ringwraiths in this epic new story of Middle-earth.",10),
(80,"Northgard",10080,"1994-12-21","Northgard is a strategy game based on Norse mythology in which you control a clan of Vikings vying for the control of a mysterious newfound continent.",15),
(81,"Quern - Undying Thoughts",10081,"2011-10-26","Quern is a first person puzzle adventure with captivating story and beautiful graphics. Quern refreshes the genre with flexible gameplay and reuseable puzzle mechanics. The visuals and the music combine traditional and modern elements providing a unique mood for the game.

One of the specialities of Quern is that the tasks to be solved are not managed as separate, individual and sequential units, but as a complex entity, amongst which the players may wander and experiment freely. Often a bad or seemingly irrational result may bring the player closer to the final solution, if those are reconsidered and thought over again later, in the possession of the knowledge gained during the game.",5),
(82,"Darksiders III",10082,"2003-3-9","Return to an apocalyptic planet Earth in Darksiders III, a hack-n-slash action adventure where players take on the role of FURY in her quest to hunt down and dispose of the Seven Deadly Sins. The Charred Council calls upon Fury to battle from the heights of heaven down through the depths of hell in a quest to restore humanity and prove that she is the most powerful of the Horsemen. As a mage, FURY relies on her whip and magic to restore the balance between good and evil. The expansive, Darksiders III game world is presented as an open-ended, living, free-form planet Earth that is dilapidated by war and decay, and overrun by nature. FURY will move back and forth between environments to uncover secrets while advancing the Darksiders III story.",25),
(83,"Earthlock: Festival of Magic",10083,"1980-5-27","An original turn-based role-playing game set in a world of machines and magic, a world that stopped spinning thousands of years ago. 
 
Rich, non-linear story 
Turn-based combat (No Active Time Battle) 
Combat pairs (Allows more variations to your battle team) 
Grow your own ammunition (Organic crafting) 
Build and improve your home base 
Environmental Puzzles 
Gorgeous overworld with a retro feel 
No random encounters (Monsters visible at all times) 
Play as Male or Female protagonist (You can switch at any time)",50),
(84,"ECHO",10084,"1982-6-15","After a century in stasis the girl En arrives at her destination: A Palace out of legend, a marvel of the old civilization eons gone, still awaiting its first human occupants. Out here, using forgotten technologies, she hopes to bring back a life that shouldnt have been lost. 
 
In ECHO everything has consequence: As you try to wield its magical technologies it becomes apparent that the Palace has a will of its own It studies everything you do, everything you are  to use it against you. 
 
The Palace creates Echoes  exact copies of you in every way. They behave like you and only do the things you do. So the way you play the game shapes your enemy. If you run, soon the Echoes will get faster. If you sneak, they will get stealthier. If you shoot, they will start to shoot back. The game constantly reacts to your every choice and input. 
 
The Palace reboots every few minutes, resulting ",20),
(85,"The Legend of Zelda: Breath of the Wild",10085,"1996-3-22","Step into a world of discovery, exploration and adventure in The Legend of Zelda: Breath of the Wild, a boundary-breaking new game in the acclaimed series. Travel across fields, through forests and to mountain peaks as you discover what has become of the ruined kingdom of Hyrule in this stunning open-air adventure.",40),
