(87,"East India Company: Pirate Bay",10087,"1995-7-8","East India Company did not originally have pirates as a playable faction as we wanted to concentrate on the actual companies. However, we received an incredible amount of feedback from people who told us how much they would love to play as pirates.",15),
(88,"Drawful 2",10088,"2006-12-17","The team behind the hit party games Fibbage, Quiplash, and YOU DONT KNOW JACK presents Drawful 2, the game of terrible drawings and hilariously wrong answers! 
 
You use your phone or tablet to draw weird and funny things like pitcher of nachos or death by trombone. The other players type in what they think the (probably terrible) drawing is and those become the multiple-choice wrong answers. Then everyone - even an audience of potentially thousands  tries to guess the REAL answer. 
 
Drawful 2 is a go-to party game that everyone can play and enjoy!",15),
(89,"The Last of Us",10089,"1992-4-4","Twenty years after a mutated fungus started turning people all over the world into deadly zombies, humans become an endangered species. Joel, a Texan in his forties with the emotional range of a teaspoon (to quote Hermione from Harry Potter), finds himself responsible with the safety of a fourteen year old girl named Ellie whom he must smuggle to a militia group called the Fireflies. And as if the infected arent enough of a hassle, they also have to deal with the authorities who wouldnt let them leave the quarantine zone, as well as other survivors capable of killing anyone who might have something useful in their backpacks.",50),
(90,"Last Day of June",10090,"1986-4-24","A deep, interactive adventure about love and loss, beautifully depicted and offering an intense cinematic experience. What would you do to save the one you love?",5),
(91,"Outcast: Second Contact",10091,"1999-10-22","Outcast  Second Contact is the complete remake of the cult title which sparked the open world, action-adventure genre. Take off on an exploration of Adelpha, an alien world as beautiful as it is dangerous, where your heroic journey places the fate of two worlds in your hands.",25),
(92,"Call of Duty: WWII - Digital Deluxe Edition",10092,"1991-11-4","Call of Duty returns to its historical roots with Call of Duty: World War II, a blockbuster experience from Sledgehammer Games. From the beaches of Normandy to the Hrtgen Forest, experience a dramatic story highlighting some of the most dramatic and iconic moments of World War II as a young soldier who is facing the unforgiving reality of war alongside his brothers in arms. 
 
Digital Deluxe Edition Includes: 
 
Base Game 
Season Pass 
Additional Bonus Content",10),
(93,"RIGS: Mechanized Combat League",10093,"1994-6-5","A competitive first-person arena shooter developed from the ground up for Project Morpheus, RIGS: Mechanized Combat League combines mechanized combat with competitive sports to deliver the ultimate sport of the future. In stadiums around the world, teams of pilots engage in blistering gladiatorial matches in large, athletic machines known as RIGs. 

Each RIG comes with its own specialties, allowing players to develop distinctive combat styles and team tactics based on their RIGs size, shape, abilities and weapons. Once you strap on the Morpheus headset and select a RIG from your garage, youre immersed in a first-person combat experience unlike any other. Coming in 2016.",10),
(94,"What Remains of Edith Finch",10094,"1985-8-6","What Remains of Edith Finch is a collection of short stories about a cursed family in Washington State. 
 
Each story offers a chance to experience the life of a different family member with stories ranging from the early 1900s to the present day. The gameplay and tone of the stories are as varied as the family members themselves. The only constants are that each is played from a first-person perspective and that each story ends with that family members death. Its a game about what it feels like to be humbled and astonished by the vast and unknowable world around us. 
 
Youll follow Edith Finch as she explores the history of her family and tries to figure out why shes the last Finch left alive.",30),
(95,"White Day: A Labyrinth Named School",10095,"2012-5-18","Steel your nerves for a Korean horror without equal! Step into the shoes of student Hee-Min Lee and brave the terrors of Yeondu High School in a terrifying survival horror game filled with puzzles, secrets and - of course - deadly ghosts.",15),
(96,"Undertale",10096,"2011-12-9","A small child falls into the Underground, where monsters have long been banished by humans and are hunting every human that they find. The player controls the child as they try to make it back to the Surface through hostile environments, all the while killing or sparing the monsters they encounter along the way through a turn-based combat system with bullet hell elements and other unconventional game mechanics.",40),
(97,"FIFA 18",10097,"1996-9-20","Powered by Frostbite,EA SPORTS FIFA 18blurs the line between the virtual and real worlds, bringing to life the players, teams, and atmospheres that immerse you in the emotion of The Worlds Game. The biggest step in gameplay innovation in franchise history,FIFA 18introducesReal Player Motion Technology, an all-new animation system which unlocks a new level of responsiveness, and player personality  now Cristiano Ronaldo and other top players feel and move exactly like they do on the real pitch.Player Controlcombined with newTeam Styles and Positioninggive you the tools to deliverDramatic Momentsthat ignite Immersive Atmospheresaround the world. The Worlds Game also takes you on a global journey as AlexHunterReturnsalong with a star-studded cast of characters, including Cristiano Ronaldo and other European football stars. And in FIFA Ultimate Team,FUT ICONS,featuring",40),
(98,"Winds of Revenge",10098,"1981-12-23","Wind of Revenge is a simple game made by a team of 5 people during the single weekend for the Unreal Engine November Jam.",10),
(99,"Tricolour Lovestory",10099,"1995-10-2","Time flies and never comes back. But with an incredible 1-million-word script and 100+ original CGs, this game will take you back to when you were young, simple and pure. Go and get the love of your life back, start something new, or end everything in flame, thats for you to decide!",30),
(100,"The Last Guardian",10100,"1982-6-1","In a strange and mystical land, a young boy discovers a mysterious creature with which he forms a deep, unbreakable bond. The unlikely pair must rely on each other to journey through towering, treacherous ruins filled with unknown dangers. Experience the journey of a lifetime in this touching, emotional story of friendship and trust.",55);
